import{r as i,o as r,c as n,a,b as t,F as d,e as s,d as e}from"./app.41443102.js";import{_ as h}from"./plugin-vue_export-helper.21dcd24c.js";const c={},p=s('<h1 id="\u110C\u1161\u110C\u116E-\u1106\u116E\u11AE\u1102\u1173\u11AB-\u110C\u1175\u11AF\u1106\u116E\u11AB" tabindex="-1"><a class="header-anchor" href="#\u110C\u1161\u110C\u116E-\u1106\u116E\u11AE\u1102\u1173\u11AB-\u110C\u1175\u11AF\u1106\u116E\u11AB" aria-hidden="true">#</a> \uC790\uC8FC \uBB3B\uB294 \uC9C8\uBB38</h1><p>\uC5EC\uAE30\uC5D0\uC11C\uB294 Misskey\uB97C \uC774\uC6A9\uD558\uBA74\uC11C \uC790\uC8FC \uBB3B\uB294 \uC9C8\uBB38\uC5D0 \uB300\uD574 \uB2E4\uB8E8\uACE0 \uC788\uC2B5\uB2C8\uB2E4. <br> Misskey \uD504\uB85C\uC81D\uD2B8 \uC790\uCCB4\uC5D0 \uB300\uD55C \uC790\uC8FC \uBB3B\uB294 \uC9C8\uBB38\uC740 <a href="./misskey">\uC5EC\uAE30\uC5D0\uC11C</a>\uC5D0\uC11C \uD655\uC778\uD558\uC2E4 \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p><h2 id="android-ios\u110B\u116D\u11BC-\u110B\u1165\u1111\u1173\u11AF\u1105\u1175\u110F\u1166\u110B\u1175\u1109\u1167\u11AB\u110B\u1175-\u110B\u1175\u11BB\u1102\u1161\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#android-ios\u110B\u116D\u11BC-\u110B\u1165\u1111\u1173\u11AF\u1105\u1175\u110F\u1166\u110B\u1175\u1109\u1167\u11AB\u110B\u1175-\u110B\u1175\u11BB\u1102\u1161\u110B\u116D" aria-hidden="true">#</a> Android/iOS\uC6A9 \uC5B4\uD50C\uB9AC\uCF00\uC774\uC158\uC774 \uC788\uB098\uC694?</h2><p>Misskey \uD504\uB85C\uC81D\uD2B8\uC5D0\uC11C \uD2B9\uC815 OS\uB97C \uB300\uC0C1\uC73C\uB85C \uD558\uC5EC \uAC1C\uBC1C\uD558\uACE0 \uC788\uB294 \uC5B4\uD50C\uB9AC\uCF00\uC774\uC158\uC740 \uC5C6\uC9C0\uB9CC, \uC81C 3\uC790\uC5D0 \uC758\uD574 \uAC1C\uBC1C\uB41C \uC11C\uB4DC\uD30C\uD2F0 \uC5B4\uD50C\uB9AC\uCF00\uC774\uC158\uC774 \uC874\uC7AC\uD569\uB2C8\uB2E4. \uC790\uC138\uD55C \uC0AC\uD56D\uC740 <a href="./apps">\uC5EC\uAE30</a>\uC5D0\uC11C \uD655\uC778\uD558\uC2E4 \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p><p>\uB2E8, \uC11C\uB4DC\uD30C\uD2F0 \uC5B4\uD50C\uB9AC\uCF00\uC774\uC158\uC740 Misskey\uC758 \uCD5C\uC2E0 \uAE30\uB2A5\uC744 \uC774\uC6A9\uD560 \uC218 \uC5C6\uB294 \uACBD\uC6B0\uAC00 \uD544\uC5F0\uC801\uC73C\uB85C \uBC1C\uC0DD\uD558\uAE30 \uB54C\uBB38\uC5D0, \uD544\uC694\uD55C \uACBD\uC6B0\uAC00 \uC544\uB2C8\uB77C\uBA74 \uACF5\uC2DD Misskey Web \uD074\uB77C\uC774\uC5B8\uD2B8\uB97C \uC774\uC6A9\uD558\uC2DC\uB294 \uAC83\uC744 \uCD94\uCC9C\uB4DC\uB9BD\uB2C8\uB2E4. \uB610\uD55C, \uACF5\uC2DD Web \uD074\uB77C\uC774\uC5B8\uD2B8\uB294 PWA\uB97C \uC9C0\uC6D0\uD558\uACE0 \uC788\uC5B4 \uC77C\uBC18\uC801\uC778 \uC571\uCC98\uB7FC \uC0AC\uC6A9\uD558\uC2E4 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uC790\uC138\uD55C \uC0AC\uD56D\uC740 <a href="./todo">\uC5EC\uAE30</a>\uC5D0\uC11C \uD655\uC778\uD558\uC2E4 \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p><h2 id="mastodon\u110B\u116D\u11BC-\u110B\u1165\u1111\u1173\u11AF\u1105\u1175\u110F\u1166\u110B\u1175\u1109\u1167\u11AB\u110B\u1173\u1105\u1169-\u1105\u1169\u1100\u1173\u110B\u1175\u11AB\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1175\u11BB\u1102\u1161\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#mastodon\u110B\u116D\u11BC-\u110B\u1165\u1111\u1173\u11AF\u1105\u1175\u110F\u1166\u110B\u1175\u1109\u1167\u11AB\u110B\u1173\u1105\u1169-\u1105\u1169\u1100\u1173\u110B\u1175\u11AB\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1175\u11BB\u1102\u1161\u110B\u116D" aria-hidden="true">#</a> Mastodon\uC6A9 \uC5B4\uD50C\uB9AC\uCF00\uC774\uC158\uC73C\uB85C \uB85C\uADF8\uC778\uD560 \uC218 \uC788\uB098\uC694?</h2><p>Misskey\uC740 Mastodon\uC758 API\uC640 \uD638\uD658\uB418\uC9C0 \uC54A\uC544, \uC77C\uBD80\uB97C \uC81C\uC678\uD558\uBA74 Mastodon\uC6A9 \uC5B4\uD50C\uB9AC\uCF00\uC774\uC158\uC774\uB098 \uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8\uB85C\uB294 Misskey\uB97C \uC774\uC6A9\uD558\uC2E4 \uC218 \uC5C6\uC2B5\uB2C8\uB2E4. Misskey \uACF5\uC2DD \uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8\uB97C \uC774\uC6A9\uD574 \uC8FC\uC2ED\uC2DC\uC624.</p><h2 id="\u1103\u1161\u1105\u1173\u11AB-\u1109\u1165\u1107\u1165\u110B\u1174-\u110B\u1172\u110C\u1165\u1105\u1173\u11AF-\u1111\u1161\u11AF\u1105\u1169\u110B\u116E\u1112\u1161\u1100\u1169-\u1109\u1175\u11C1\u110B\u1165\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#\u1103\u1161\u1105\u1173\u11AB-\u1109\u1165\u1107\u1165\u110B\u1174-\u110B\u1172\u110C\u1165\u1105\u1173\u11AF-\u1111\u1161\u11AF\u1105\u1169\u110B\u116E\u1112\u1161\u1100\u1169-\u1109\u1175\u11C1\u110B\u1165\u110B\u116D" aria-hidden="true">#</a> \uB2E4\uB978 \uC11C\uBC84\uC758 \uC720\uC800\uB97C \uD314\uB85C\uC6B0\uD558\uACE0 \uC2F6\uC5B4\uC694!</h2><p>\uBA54\uB274\uC5D0\uC11C \uAC80\uC0C9\uC744 \uC120\uD0DD\uD558\uC5EC, \uD314\uB85C\uC6B0\uD558\uB824\uB294 \uC720\uC800\uC758 \uC8FC\uC18C\uB97C \uC785\uB825\uD558\uC5EC \uB2E4\uB978 \uC11C\uBC84\uC758 \uC720\uC800\uB97C \uCC3E\uC744 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uC720\uC800\uC758 \uC8FC\uC18C\uB294 \uC774\uBA54\uC77C \uC8FC\uC18C\uC640 \uBE44\uC2B7\uD55C \uD615\uD0DC\uB85C, <strong>@\uB85C \uC2DC\uC791\uD558\uB294 \uC0AC\uC6A9\uC790\uBA85</strong>\uACFC <strong>\uC720\uC800\uAC00 \uC18D\uD55C \uC11C\uBC84\uC758 \uD638\uC2A4\uD2B8\uBA85</strong>\uC73C\uB85C \uC774\uB8E8\uC5B4\uC838 \uC788\uC2B5\uB2C8\uB2E4.</p><p>\uC608\uB97C \uB4E4\uC5B4, <code>misskey.io</code>\uC5D0 \uC788\uB294 <code>@syuilo</code>\uB77C\uB294 \uC720\uC800\uB97C \uCC3E\uC744 \uB54C\uC5D0\uB294, <code>@syuilo@misskey.io</code>\uC640 \uAC19\uC774 \uC785\uB825\uD569\uB2C8\uB2E4.</p><p>Misskey\uBFD0\uB9CC \uC544\uB2C8\uB77C, Mastodon\uC774\uB098 Pleroma\uB97C \uBE44\uB86F\uD55C \uB9CE\uC740 \uBD84\uC0B0\uD615 \uD50C\uB7AB\uD3FC\uC5D0\uC11C \uC774\uB7EC\uD55C \uC8FC\uC18C \uD615\uC2DD\uC744 \uC0AC\uC6A9\uD558\uC5EC \uB2E4\uB978 \uC11C\uBC84\uC758 \uC720\uC800\uB97C \uCC3E\uC744 \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p><h2 id="misskey-io\u1102\u1173\u11AB-misskey-\u1100\u1169\u11BC\u1109\u1175\u11A8-\u110B\u1175\u11AB\u1109\u1173\u1110\u1165\u11AB\u1109\u1173\u110B\u1175\u11AB\u1100\u1161\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#misskey-io\u1102\u1173\u11AB-misskey-\u1100\u1169\u11BC\u1109\u1175\u11A8-\u110B\u1175\u11AB\u1109\u1173\u1110\u1165\u11AB\u1109\u1173\u110B\u1175\u11AB\u1100\u1161\u110B\u116D" aria-hidden="true">#</a> misskey.io\uB294 Misskey \uACF5\uC2DD \uC778\uC2A4\uD134\uC2A4\uC778\uAC00\uC694?</h2><p>misskey.io\uB294 Misskey \uACF5\uC2DD \uC778\uC2A4\uD134\uC2A4\uAC00 \uC544\uB2C8\uBA70, Misskey \uD504\uB85C\uC81D\uD2B8\uC640 \uBCC4\uAC1C\uB85C \uC6B4\uC601\uB418\uACE0 \uC788\uC2B5\uB2C8\uB2E4. misskey.io\uB294 \uD2B9\uC815\uD55C \uC8FC\uC81C \uC5C6\uC774 \uB2E4\uC591\uD55C \uC774\uC57C\uAE30\uAC00 \uC624\uAC00\uBA70, \uAC00\uBCBC\uC6B4 \uB9C8\uC74C\uC73C\uB85C \uC774\uC6A9\uD560 \uC218 \uC788\uB294 Misskey \uCD5C\uB300 \uADDC\uBAA8 \uC778\uC2A4\uD134\uC2A4\uC785\uB2C8\uB2E4.</p><h2 id="\u300Cmisskey\u300D\u306E\u540D\u524D\u306E\u7531\u6765\u306F\u4F55\u3066\u3099\u3059\u304B" tabindex="-1"><a class="header-anchor" href="#\u300Cmisskey\u300D\u306E\u540D\u524D\u306E\u7531\u6765\u306F\u4F55\u3066\u3099\u3059\u304B" aria-hidden="true">#</a> \u300CMisskey\u300D\u306E\u540D\u524D\u306E\u7531\u6765\u306F\u4F55\u3067\u3059\u304B\uFF1F</h2><p>syuilo\u304C\u305D\u306E\u540D\u524D\u3092\u8003\u3048\u3066\u3044\u305F\u3068\u304D\u306B\u5076\u7136\u8074\u3044\u3066\u3044\u305F\u3001May&#39;n\u306E\u697D\u66F2\u300EBrain Diver\u300F\u306E\u6B4C\u8A5E\u304B\u3089\u63A1\u3089\u308C\u3066\u3044\u307E\u3059\u3002</p><h2 id="how-do-i-take-back-a-renote" tabindex="-1"><a class="header-anchor" href="#how-do-i-take-back-a-renote" aria-hidden="true">#</a> &quot;How do I take back a Renote?&quot;</h2><p>Press the three dots (&quot;...&quot;) displayed next to the renote timestamp and select &quot;Take back Renote&quot;. To read more about Renotes, please check <a href="../features/note">here</a>.</p><h2 id="i-don-t-want-the-preview-of-an-url-to-be-displayed" tabindex="-1"><a class="header-anchor" href="#i-don-t-want-the-preview-of-an-url-to-be-displayed" aria-hidden="true">#</a> &quot;I don&#39;t want the preview of an URL to be displayed.&quot;</h2>',18),l=e